import Link from "next/link";
import Header from "../components/header";
import Button from '@material-ui/core/Button';

function Index() {
  return (
    <main>
      <Header />
      <section>
        <Link href="/about">
          <a>Go to About Me</a>
          <Button variant="contained" color="primary">
            Hello World
          </Button>
        </Link>
      </section>
    </main>
  );
}

export default Index;
